// SPDX-License-Identifier: MIT
pragma solidity ^0.8.10;

/**
 * @title MyToken
 * @dev 一个简单的代币合约，用于演示底层调用。
 */
contract MyToken {
    // 记录每个地址的代币余额
    mapping(address => uint256) public balanceOf;

    /**
     * @dev 构造函数。部署合约时，会给部署者（msg.sender）分配 1000 个代币。
     */
    constructor() {
        balanceOf[msg.sender] = 1000;
    }

    /**
     * @dev 转账函数。
     * @param _to 接收代币的目标地址。
     * @param amount 要转账的代币数量。
     * @return 转账成功返回 true。
     */
    function transfer(address _to, uint256 amount) public returns (bool) {
        // 检查发送者（msg.sender）的余额是否足够
        require(balanceOf[msg.sender] >= amount, "MyToken: Insufficient balance");
        
        // 从发送者余额中减去相应数量
        balanceOf[msg.sender] -= amount;
        // 给接收者余额增加相应数量
        balanceOf[_to] += amount;
        
        return true;
    }
}

/**
 * @title FunctionSelector
 * @dev 一个工具合约，用于计算并返回给定函数签名的函数选择器。
 */
contract FunctionSelector {

    /**
     * @dev 计算并返回函数选择器。
     * @param _func 函数签名字符串，例如 "transfer(address,uint256)"。
     * @return 对应的 4 字节函数选择器。
     */
    function getSelector(string calldata _func) external pure returns (bytes4) {
        // 1. 将函数签名字符串转换为字节数组
        // 2. 对字节数组进行 keccak256 哈希
        // 3. 取哈希结果的前 4 个字节，即为函数选择器
        return bytes4(keccak256(bytes(_func)));
    }
}

/**
 * @title CallerContract
 * @dev 一个演示合约，用于通过底层调用（call/delegatecall）与 MyToken 合约交互。
 */
contract CallerContract {

    /**
     * @dev 使用 delegatecall 调用 MyToken 的 transfer 函数。
     * 
     * WARNING: 这会执行 MyToken 的 transfer 函数代码，但会操作 CallerContract 自己的存储。
     * 因为 CallerContract 没有名为 balanceOf 的 mapping，所以调用几乎肯定会因为 "Insufficient balance" 而失败。
     * 这是一个教学示例，展示了 delegatecall 的特性，而不是一个实用的功能。
     *
     * @param tokenAddress MyToken 合约的地址。
     * @param transferSelector transfer 函数的函数选择器 (例如 0xa9059cbb)。
     * @param _to 接收代币的目标地址。
     * @param amount 要转账的代币数量。
     * @return 调用成功且转账成功则返回 true。
     */
    function callTransfer(
        address tokenAddress, 
        bytes4 transferSelector, 
        address _to, 
        uint256 amount
    ) public returns (bool) {
        // 使用 delegatecall 调用目标合约
        // 注意：msg.sender 会保持为调用 CallerContract 的外部账户
        // 但存储操作会发生在 CallerContract 上
        (bool success, bytes memory returnData) = tokenAddress.delegatecall(
            abi.encodeWithSelector(transferSelector, _to, amount)
        );

        // 如果调用失败（例如，内部 revert），则此处 revert
        require(success, "CallerContract: Call to transfer failed");

        // 解码返回数据，预期是一个 bool 值
        return abi.decode(returnData, (bool));
    }

    /**
     * @dev 使用 call 调用 MyToken 的 transfer 函数。
     * 
     * 这是与其他合约交互的标准方式。它会切换到 MyToken 的上下文。
     * MyToken 合约中看到的 msg.sender 会是 CallerContract 的地址。
     * 因此，要使此调用成功，CallerContract 地址必须在 MyToken 合约中有足够的余额。
     *
     * @param tokenAddress MyToken 合约的地址。
     * @param transferSelector transfer 函数的函数选择器 (例如 0xa9059cbb)。
     * @param _to 接收代币的目标地址。
     * @param amount 要转账的代币数量。
     * @return 调用成功且转账成功则返回 true。
     */
    function standardCallTransfer(
        address tokenAddress, 
        bytes4 transferSelector, 
        address _to, 
        uint256 amount
    ) public returns (bool) {
        // 使用 call 调用目标合约
        // 注意：MyToken 合约中看到的 msg.sender 会是 this (CallerContract)
        (bool success, bytes memory returnData) = tokenAddress.call(
            abi.encodeWithSelector(transferSelector, _to, amount)
        );

        require(success, "CallerContract: Standard call to transfer failed");

        return abi.decode(returnData, (bool));
    }
}

